import React from "react";
import ReactDom from "react-dom";

const name = "javascripthtml";
 //ReactDom.render('kya dikhana hai','kaha dikhana hai','callfunction func');
 ReactDom.render( <>
                  <h1> Netflix channel pvt.ltd </h1>
                  <h3> web series </h3>
                  <h3>list {name}</h3>
                  <ol>
                    <li> secreate game {10-8} </li>
                    <li> secreate game 2 </li>
                    <li> secreate game 3 </li>
                    <li> secreate game 4 </li>
                    <li> secreate game 5 </li>
                    <li >secreate game 6 </li>
                  </ol>

                  </>,
                  document.getElementById('root'));
